class Addbook extends Component{
    render(){
        return (
        <form id="form">
Bookid: <input name="id" type="number" />
<br />
BookName: <input name="full-name" type="text" />
<br />
Author: <input name="Name" type="text" />
<br />
Edition: <input name="Name" type="text" />
<br />
Date: <input name="date" type="date" />
<br />
<input type="submit" name="submit"  />
</form>
);
    }
}
export default Addbook;
